import React from "react";

import Layout from "../components/Layout";

function Projects() {
  return (
    <>
      <Layout secondaryPage>
        <strong className="page-header">
          I've worked on a couple of projects
        </strong>
      </Layout>
    </>
  );
}

export default Projects;
